import React, { useState } from 'react';
import ToDoList from './ToDoList';

const App = () =>{

 const [text, settext] = useState("");
 const [btn , setbtn] = useState([]);
  const write = (event) => {
    settext(event.target.value);
  };
  const btnClick = () => {
    setbtn((oldprev) =>{
      return  [...oldprev, text];
       
    });
    settext("");
  }
  return(
    <>
    <div className='main_div'>
      <div className='center_div'>
        <br />
        <h1>ToDo List</h1>
        <br />
        <input type="text" placeholder='Add items' onChange={write} value={text} />
        <button onClick={btnClick}> + </button>
        <ol>
          {btn.map( (textVal) =>{
            return <ToDoList
            text = {textVal}/>
          })}
        </ol>
      </div>
    </div>

    </>
  )
}
export default App;
